const GetListDoctorSearch = async (keyWord, method) => {
  if (method === 'name') {
//    console.log('aaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaa', keyWord, '');

    var url = `http://192.168.1.4:3069/doctor/?name=${keyWord}`;
    return await fetch(url).then((response) => response.json());
  } else if (method === 'expertise') {

    var url = `http://192.168.1.4:3069/doctor/?expertise=${keyWord}`;
    return await fetch(url).then((response) => response.json());
  } else {

    var url = `http://192.168.1.4:3069/doctor/?hospital=${keyWord}`;
    return await fetch(url).then((response) => response.json());
  }
};

export default GetListDoctorSearch;
